import React from 'react';
import '../styles/air_quality.css';

function AirQuality() {
  return (
    <div className='air-quality'>
    <div className='air-quality-title'>Air Quality</div>
    <div className='air-quality-content'>
    <div className='air-quality-present'>
    72
    </div>
    <div className='air-quality-no'>
        <div className='air-quality-high'><i className="fa-light fa-arrow-up"></i>93<span className='celsius'>&#8451;</span></div>
        <div className='air-quality-low'>61<span className='celsius'>&#8451;</span></div>
    </div>
    </div>
    
    </div>
  )
}

export default AirQuality
